var $bm_rt;
var ctrl, x, c, h, h, h;
ctrl = thisComp.layer('Chair Rotation');
x = ctrl.transform.position[0];
c = $bm_mul($bm_div(ctrl.effect('Slider')(3).value, 100), 20);
h = $bm_sum(ctrl.effect('Slider')(8).value, c);
h = $bm_sub(h, c);
h = $bm_div(h, 2);
$bm_rt = linear(x, $bm_neg(h), h, -100, 100);

